responses.body:
{
  "body": {
    "style": "height: 50vh;display: flex;flex-wrap: wrap;justify-content: center;align-items: center;",
    "child": [
      {
        "element": "div",
        "style": "width: 500px;height: 280px;background-color: #f542e6;border-radius: 12px;display: flex;flex-wrap: wrap;justify-content: space-around;align-items: flex-start;padding: 20px;",
        "child": [
          {
            "element": "div",
            "style": "width: 30%;",
            "child": [
              {
                "element": "img",
                "style": " width: 100%;",
                "src": "profile.png"
              }
            ]
          },
          {
            "element": "div",
            "style": "line-height: 40px;",
            "child": [
              {
                "element": "p",
                "style": "font-size: x-large;",
                "text": "Name :",
                "child": [
                  {
                    "element": "span",
                    "style": "font-size: x-large;",
                    "text": " Amelia"
                  }
                ]
              },
{
                "element": "p",
                "style": "font-size: x-large;",
                "text": "Country :",
                "child": [
                  {
                    "element": "span",
                    "style": "font-size: x-large;",
                    "text": " Myanmar"
                  }
                ]
              },

              {
                "element": "p",
                "style": "font-size: x-large;",
                "text": "Position :",
                "child": [
                  {
                    "element": "span",
                    "style": "font-size: x-large;",
                    "text": " Programmer"
                  }
                ]
              },
              {
                "element": "p",
                "style": "font-size: x-large;",
                "text": "Salary :",
                "child": [
                  {
                    "element": "span",
                    "style": "font-size: x-large;",
                    "text": " $600"
                  }
                ]
              }
            ]
          }
        ]
      }
    ]
  }
}
